import React from "react";

class SearchForm extends React.Component {
    constructor(props) {
      super(props)

      this.state = {
       keywords: '',
       city: '',
       date: ''
      }
     }

    render() {
        return (
            <form className='search-form'>
            <h1>Hello</h1>
            <p>Enter your name:</p>
            <input
              type="text"
            />
            </form>
        )
    }
}

export { SearchForm}
